import React, { Component } from 'react';
import './index.css';


class Footer extends Component {

  render(){

    return (
      <div className='footer'>
        <div>Grateful Counseling LLC</div> | <div>River Edge, New Jersey</div> | <div>Phone - (917)-612-1494</div> | <div><a href='mailto:susloquet@gmail.com' target='_blank' id='mailer' >Susloquet@gmail.com</a></div>
      </div>
    );
  }
}

export default Footer;
